  const [userIsLoggedIn, setUserIsLoggedIn] = useState(true);

  <BrowserRouter>
  {/* The rest of your app goes here */}
</BrowserRouter>
  if (userIsLoggedIn == true) {
    return (<AppAuthenticated />);
  } else {
    return (<AppUnauthenticated />)
  }

}

export default App;


